<?php

$data = "



";

$keys = [[1, 2, 3],
		 [4, 5, 6],
		 [7, 8, 9]];

$x = 1;
$y = 1;

$x_max = 2;
$y_max = 2;

$instructions = explode("\n", $data);

foreach ($instructions as &$singleLine)
{
	$x = 1;
	$y = 1;
	for	($i = 0; $i < strlen($singleLine); $i++ )
	{
		switch ($singleLine[$i])
		{
			case 'U':
				$y--;
				break;
			case 'D':
				$y++;
				break;
			case 'L':
				$x--;
				break;
			case 'R';
				$x++;
				break;
		}
		
		$x = max(0, min($x, $x_max));
		$y = max(0, min($y, $y_max));
	}
	
	echo $keys[$y][$x];
}


?>
